/* Model creation/destruction functions */

void MODEL_mkU2Tb::create_model(tSimStateHdl simHdl, bool master)
{
  sim_hdl = simHdl;
  init_reset_request_counters(sim_hdl);
  mkU2Tb_instance = new MOD_mkU2Tb(sim_hdl, "top", NULL);
  bk_get_or_define_clock(sim_hdl, "CLK");
  if (master)
  {
    bk_alter_clock(sim_hdl, bk_get_clock_by_name(sim_hdl, "CLK"), CLK_LOW, false, 0llu, 5llu, 5llu);
    bk_use_default_reset(sim_hdl);
  }
  bk_set_clock_event_fn(sim_hdl,
			bk_get_clock_by_name(sim_hdl, "CLK"),
			schedule_posedge_CLK,
			NULL,
			(tEdgeDirection)(POSEDGE));
  (mkU2Tb_instance->INST_dut.INST_fifo_in.set_clk_0)("CLK");
  (mkU2Tb_instance->INST_dut.INST_fifo_out.set_clk_0)("CLK");
  (mkU2Tb_instance->INST_dut.set_clk_0)("CLK");
  (mkU2Tb_instance->INST_start_wire.set_clk_0)("CLK");
  (mkU2Tb_instance->INST_start_reg_2.set_clk_0)("CLK");
  (mkU2Tb_instance->INST_abort.set_clk_0)("CLK");
  (mkU2Tb_instance->INST_state_set_pw.set_clk_0)("CLK");
  (mkU2Tb_instance->INST_state_overlap_pw.set_clk_0)("CLK");
  (mkU2Tb_instance->INST_state_fired_1.set_clk_0)("CLK");
  (mkU2Tb_instance->INST_par_running.set_clk_0)("CLK");
  (mkU2Tb_instance->INST_par_blocks_start_wire.set_clk_0)("CLK");
  (mkU2Tb_instance->INST_par_blocks_start_reg_1.set_clk_0)("CLK");
  (mkU2Tb_instance->INST_par_blocks_abort.set_clk_0)("CLK");
  (mkU2Tb_instance->INST_par_blocks_state_set_pw.set_clk_0)("CLK");
  (mkU2Tb_instance->INST_par_blocks_state_overlap_pw.set_clk_0)("CLK");
  (mkU2Tb_instance->INST_par_blocks_state_fired_1.set_clk_0)("CLK");
  (mkU2Tb_instance->INST_par_blocks_1_start_wire.set_clk_0)("CLK");
  (mkU2Tb_instance->INST_par_blocks_1_start_reg_1.set_clk_0)("CLK");
  (mkU2Tb_instance->INST_par_blocks_1_abort.set_clk_0)("CLK");
  (mkU2Tb_instance->INST_par_blocks_1_state_set_pw.set_clk_0)("CLK");
  (mkU2Tb_instance->INST_par_blocks_1_state_overlap_pw.set_clk_0)("CLK");
  (mkU2Tb_instance->INST_par_blocks_1_state_fired_1.set_clk_0)("CLK");
  (mkU2Tb_instance->set_clk_0)("CLK");
}
void MODEL_mkU2Tb::destroy_model()
{
  delete mkU2Tb_instance;
  mkU2Tb_instance = NULL;
}
void MODEL_mkU2Tb::reset_model(bool asserted)
{
  (mkU2Tb_instance->reset_RST_N)(asserted ? (tUInt8)0u : (tUInt8)1u);
}
void * MODEL_mkU2Tb::get_instance()
{
  return mkU2Tb_instance;
}

