/* State dumping function */
void MODEL_mkU2Tb::dump_state()
{
  (mkU2Tb_instance->dump_state)(0u);
}

/* VCD dumping functions */
MOD_mkU2Tb & mkU2Tb_backing(tSimStateHdl simHdl)
{
  static MOD_mkU2Tb *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkU2Tb(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkU2Tb::dump_VCD_defs()
{
  (mkU2Tb_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkU2Tb::dump_VCD(tVCDDumpType dt)
{
  (mkU2Tb_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkU2Tb_backing(sim_hdl));
}
